CommonData.BannerCustomCSS:
#onetrust-banner-sdk {
  border-radius: 4px !important;
}

#ot-sdk-btn-floating.ot-floating-button {
  display: none !important;
}

#onetrust-banner-sdk #onetrust-close-btn-container {
display:none;
}

.banner-header {
margin-bottom: 10px !important;
}

#onetrust-banner-sdk.ot-bnr-w-logo .ot-bnr-logo {
    width: auto;
    height: 42px;
    margin: 4px 30px;
}

.ot-btn-container::before,
.ot-btn-container::after {
    display: none;
}

#onetrust-banner-sdk.otCenterRounded {
    top: 50%;
    transform: translate(0, -50%);
    max-width: 800px;
    left: 0;
}

#onetrust-banner-sdk button {
    border-radius: 4px;
    font-size: 14px !important;
}

#onetrust-policy-text,
#ot-pc-desc {
    font-size:14px !important;
}

#onetrust-consent-sdk #onetrust-banner-sdk a[href] {
   text-decoration: none;
}

#onetrust-consent-sdk #onetrust-banner-sdk a[href]:hover {
   text-decoration: underline;
}

@media only screen and (max-width: 600px) {
    #onetrust-banner-sdk {
       border-radius: 0px !important;
    }

    #onetrust-banner-sdk.ot-bnr-w-logo .ot-bnr-logo {
        height: 32px;
        margin: 4px 22px;
    }

    #onetrust-policy-text {
        font-size:12px !important;
    }

    #onetrust-banner-sdk button {
        padding: 10px !important;
        line-height: 1 !important;
    }
}

CommonData.PCCustomCSS:
#onetrust-pc-sdk {
  min-width: 0;
  width: 100% !important;
  max-width: 800px !important;
  top: 50% !important;
  transform: translate(0, -50%);
  border-radius: 4px !important;
}

#onetrust-pc-sdk .ot-pc-header {
   min-height: 34px;
    display: flex;
    align-items: center;
padding: 20px 0 20px 30px;
}

#onetrust-pc-sdk .ot-pc-logo {
  margin-left: 4px;
  height: 34px !important;
  width: auto !important;
}

#onetrust-pc-sdk #ot-pc-content {
   top: 75px !important;
}

#onetrust-pc-sdk #ot-pc-desc .privacy-notice-link {
      display: none;
}

.ot-pc-footer-logo {
    display: none;
}

.otPcTab [class*='btn-']::before {
    background: none;
    cursor: auto;
}

.otPcTab [class*='btn-']::after {
    background: none;
    cursor: auto;
}

#onetrust-pc-sdk {
    border-radius: 4px;
}

.ot-acc-hdr {
   padding: 12px 0 !important;
}

#onetrust-pc-sdk .ot-accordion-layout.ot-cat-item:first-of-type {
   border: none !important;
}
#onetrust-pc-sdk .ot-accordion-layout.ot-cat-item {
    border: none;
    border-top: 2px solid #e7e9eb;
}

.ot-btn-container button:before, 
.ot-btn-container button:after, 
.ot-btn-subcntr:before,
.ot-btn-subcntr:after {
    display: none;
}

#onetrust-pc-sdk button {
    border-radius: 4px !important;
    font-size: 14px !important;
}

#onetrust-pc-sdk .ot-tgl input:checked+.ot-switch .ot-switch-nob:before {
    background-color: #37003c;
}

.ot-cat-header,
.ot-pvcy-hdr {
    font-size: 16px !important;
}

.ot-category-desc,
.ot-pc-desc {
    font-size: 14px !important;
}

#onetrust-pc-sdk .ot-switch-nob {
    background-color: #E8E8E8 !important;
    border: 1px solid #E8E8E8 !important;
}

#onetrust-pc-sdk .ot-switch-nob:before {
background-color: #fff !important;
box-shadow: 0px 3px 8px rgb(0 0 0 / 15%), 0px 3px 1px rgb(0 0 0 / 6%);
}

#onetrust-pc-sdk .ot-tgl input:checked+.ot-switch .ot-switch-nob {
    background-color: #00FF87 !important;
    border: 1px solid #fff !important;
}

@media only screen and (max-width: 600px) {
    #onetrust-pc-sdk {
       border-radius: 4px !important;
    }

    .ot-cat-header,
    .ot-pvcy-hdr {
        font-size: 14px !important;
    }

    .ot-category-desc,
    .ot-pc-desc {
        font-size: 12px !important;
    }

    #onetrust-pc-sdk button {
        line-height: 1 !important;
        padding: 10px !important;
    }
}

CommonData.CookieListCustomCss:
